function scrollToTop(){document.querySelector(".back-to-top").addEventListener("click",function(){window.scrollTo({top:0,behavior:"smooth"})})}function swiperSong(){document.querySelector(".swiper-music")&&new Swiper(".swiper-music",{slidesPerView:3,spaceBetween:-10,centeredSlides:!0,loop:!0,pagination:{el:".swiper-pagination",clickable:!0}})}function swiperTickets(){document.querySelector(".swiper-tickets")&&new Swiper(".swiper-tickets",{slidesPerView:5,spaceBetween:24,pagination:{el:".swiper-pagination",clickable:!0}})}export{scrollToTop,swiperSong,swiperTickets};